/* eslint-disable jsx-a11y/anchor-is-valid */
import React from 'react';

class Navbar extends React.Component {
    render() { 
        return (
            <nav className="navbar navbar-light bg-light">
                <a href="#" className="navbar-brand">Machbazaar Inventory
                </a>

                <div type="button" href="#" className="badge badge-warning p-2 mb-2 float-right">
                    <i className="fa fa-shopping-cart"></i>&nbsp;&nbsp; 
                    <span className="badge badge-light"> {this.props.counter}</span>
                </div> 
            </nav>
        );
    }
}

export default Navbar;
